import prev_btn from "../statics/prev-task-btn.svg";
import next_btn from "../statics/next-task-btn.svg";

export default function TaskNavigation(props) {
    const btnStyle = { display: "flex", alignItems: "center", justifyContent: "space-evenly", border: "none", borderRadius: "5px", width: "120px", paddingTop: "12px", paddingBottom: "12px" }
    return (
        <div className="task-navigation-container" style={{ display: "flex" }}>
            <button
                className="prev-task"
                onClick={props.handleNavifationButtonClick("prev")}
                style={btnStyle}
            >
                <img id="prev-btn-img" src={prev_btn} alt="."></img> Previous Task
            </button>
            <button
                className="next-task"
                onClick={props.handleNavifationButtonClick("next")}
                style={btnStyle}
            >
                Next Task <img id="prev-btn-img" src={next_btn} alt="."></img>
            </button>
        </div>
    );
}
